import axios from "axios";
import { useEffect, useState } from "react";
import Galaxy_S7 from "../assets/images/Galaxy_S7.png";
import Honor_10 from "../assets/images/Galaxy_S7.png";
import IPhone_7 from "../assets/images/Galaxy_S7.png";
import Moto_G6 from "../assets/images/Galaxy_S7.png";
import Nokia_71 from "../assets/images/Galaxy_S7.png";
import P10_Lite from "../assets/images/Galaxy_S7.png";
import Xiaomi_MI_A2 from "../assets/images/Galaxy_S7.png";
import ZenPhone_5 from "../assets/images/Galaxy_S7.png";

function Phones() {
  const [phones, setPhones] = useState();
  useEffect(() => {
    axios
      .get("http://localhost:5005/api/phones")
      .then((response) => {
        setPhones(response.data);
        console.log(response.data);
      })
      .catch((error) => {
        console.log("error: ", error);
      });
  }, []);

  return (
    <>
      <h1>Phones</h1>
      {phones &&
        phones.map((phone) => {
          return (
            <>
              <h1>{phone.name}</h1>
              <img
                src={`${Galaxy_S7}`}
                alt={`${phone.imageFileName.slice(
                  0,
                  phone.imageFileName.indexOf(".")
                )}`}
              />
            </>
          );
        })}
    </>
  );
}
export default Phones;
